import React from 'react';
import './App.css';
import { useCookies } from 'react-cookie';

function App() {
  const [cookies, setCookie] = useCookies(['displayname','username']);
  return (
    <div className="App">
      <h1>displayname cookie: {cookies.displayname}</h1>
      <h1>username cookie: {cookies.username}</h1>
    </div>
  );
}

export default App;
